import { React, useState } from 'react'
import './navbar.css'

export default function Navbar() {

  const [activeLink, setActiveLink] = useState()
  return (
    <header>
      <div className="topnav">
        <a className="active" href="/">Home</a>
        <a href="/login">Login</a>
        <a href="/signup">Signup</a>
      </div>
    </header>
  )
}
